import React from "react";
import { Card } from "react-bootstrap";
import Masonry from "react-masonry-css";

const PicturesContainer = styled.div`
  column-count: 3;
  column-gap: 1em;
`;

const PictureCard = styled(Card)`
  break-inside: avoid;
  margin-bottom: 1em;
`;

const Pictures = () => {
  const greyTones = [
    "#f2f2f2",
    "#d9d9d9",
    "#bfbfbf",
    "#a6a6a6",
    "#8c8c8c",
    "#737373",
    "#595959",
    "#404040",
    "#262626",
    "#0d0d0d",
  ];

  return (
    <Masonry>
      {greyTones.map((tone, index) => (
        <PictureCard
          key={index}
          style={{
            backgroundColor: tone,
            height: `${100 + index * 90}px`,
          }}
        >
          <Card.Body></Card.Body>
        </PictureCard>
      ))}
    </Masonry>
  );
};

export default Pictures;
